import React from 'react';

const UserDashboard = () => {
    return (
        <div className="user-dashboard">
            <h1>User Dashboard</h1>
            <p>Chào mừng User! Quản lý tài khoản của bạn tại đây.</p>
            {/* Thêm nội dung cụ thể cho user */}
        </div>
    );
};

export default React.memo(UserDashboard);
